  let radiusA = a.r;
  let radiusB = b.r;

  let xA = a.x;
  let yA = a.y;
  let zA = a.z;

  let xB = b.x;
  let yB = b.y;
  let zB = b.z;

  let dx = xB - xA;
  let dy = yB - yA;
  let dz = zB - zA;
  let distanceCAandCBSquared = dx * dx + dy * dy + dz * dz;

  let sumOfRadius = radiusA + radiusB;

  let collided = distanceCAandCBSquared <= sumOfRadius * sumOfRadius;

